TfLiteStatus GetImage(tflite::ErrorReporter* error_reporter, int image_width,
                      int image_height, int channels, int8_t* image_data) {
  // Log that the image is being loaded
  TF_LITE_REPORT_ERROR(error_reporter, "Loading BMP image data...");

  // Check if dimensions match
  if (image_width != 96 || image_height != 96 || channels != 1) {
    TF_LITE_REPORT_ERROR(error_reporter, "Image dimensions are incorrect");
    return kTfLiteError;
  }

  // Copy BMP image data into the image_data array
  for (int i = 0; i < image_width * image_height; i++) {
    // Quantize the BMP data from [0, 255] to [-128, 127]
    image_data[i] = static_cast<int8_t>(person_bmp_image[i]) - 128;
  }

  TF_LITE_REPORT_ERROR(error_reporter, "Image loaded successfully!");
  return kTfLiteOk;
}